import logo from './logo.svg';
import './App.css';
import LunchChooser from './components/LunchChooser.component';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Lunch-Time
        </p>
      </header>
      <LunchChooser/>
    </div>
  );
}

export default App;
